import React from "react";
import { Segment } from "semantic-ui-react";

function Header() {
  return (
    <Segment inverted hort>
      <h2 class="ui header">Menu</h2>
      <h3 class="ui header">Login</h3>
      <h3 class="ui header">Register</h3>
    </Segment>
  );
}

export default Header;
